import React from 'react';
import styled from 'styled-components';
import { FooterContainer, FooterTextBackgroundGreen, FooterTextBackgroundYellow, FooterTextBackgroundRed, FooterText } from './footer.styles';

const FooterCopyrightContainer = styled.div`
  height: 50px;
  width: 100%;
  background-color: ${({ theme }) => theme.primaryDark};


`;

const FooterCopyrightText = styled.p`
  display: flex;
  justify-content: center;
  margin-top: 50px;
`;

const Footer = () => {
    var d = new Date();
    var n = d.getFullYear();
    return (
        <FooterContainer>
          <FooterTextBackgroundYellow>
            &nbsp;
          </FooterTextBackgroundYellow>
          <FooterTextBackgroundYellow>
            &nbsp;
          </FooterTextBackgroundYellow>
          <FooterTextBackgroundGreen>
            &nbsp;
            <center><FooterCopyrightContainer><FooterCopyrightText>&#169; {n}, dale st. studio</FooterCopyrightText></FooterCopyrightContainer></center>
          </FooterTextBackgroundGreen>
        </FooterContainer>
    );
};

export default Footer;
